	inputs:{
        rawData: 'array'
	},

	outputs:{
	    formattedArray: 'array'
	},

	changed:{

		rawData:function() {  
		     let rawData = this.inputs.rawData;
		     let formattedArray = Noodl.Array.get("FormattedArray");


		     rawData.each((object) =>{

		         let riderName = object.data.rider; 
		         let newObj;

		         if(Noodl.Object.exists(riderName)){
		             newObj = Noodl.Object.get(riderName);
		             newObj.data.events.add(object);
		         }
		         else{
		            let eventArr = 
		            newObj = Noodl.Object.create({
		                id: riderName,
		                name: riderName,
		                events: Noodl.Array.get()
		             });
		             newObj.data.events.add(object);

		            formattedArray.add(newObj);

		         }
		     });

	        this.setOutputs({formattedArray: formattedArray});

		 }
	}
})

